                                            <div id="divInstructions" unselectable="on" style="-moz-user-select: none;"><p unselectable="on" style="-moz-user-select: none;">Please read the following instructions very carefully: </p>
                                                <p unselectable="on" style="-moz-user-select: none;">1. Read carefully the instructions before starting the test.you can read the instructions in between the exam after clicking the <strong unselectable="on" style="-moz-user-select: none;">"INSTRUCTION BUTTON".</strong><br unselectable="on" style="-moz-user-select: none;">2. You have <strong unselectable="on" style="-moz-user-select: none;">135 minutes</strong> to complete the test.<br unselectable="on" style="-moz-user-select: none;">3. The test contains a total of&nbsp;<strong unselectable="on" style="-moz-user-select: none;">200 questions</strong>.<br unselectable="on" style="-moz-user-select: none;">4. There is only one correct answer to each question. Click on the most appropriate option to mark it as your answer.<br unselectable="on" style="-moz-user-select: none;">5. You will be awarded <strong unselectable="on" style="-moz-user-select: none;">1 marks</strong> for each correct answer.<br unselectable="on" style="-moz-user-select: none;">6. There is <strong unselectable="on" style="-moz-user-select: none;">0.25 negative</strong> marks for each wrong answer.<br unselectable="on" style="-moz-user-select: none;">7. According to your selection of questions it will change the colour in the boxes at the right side window, these colours will help you to identify the required group of questions.<br unselectable="on" style="-moz-user-select: none;">8. You can unmark your answer by clicking on the<strong unselectable="on" style="-moz-user-select: none;"> "CLEAR RESPONSE"</strong> Option.<br unselectable="on" style="-moz-user-select: none;">9. You can mark a question for reviewing it later by clicking on the <strong unselectable="on" style="-moz-user-select: none;">“marked &amp; review”</strong> button.<br unselectable="on" style="-moz-user-select: none;">10. You can use the <strong unselectable="on" style="-moz-user-select: none;">"FILTER BUTTON"</strong> to select your choices individually according to your given answers.<br unselectable="on" style="-moz-user-select: none;">11. A Number list of all questions appears at the right hand side of the window. You can access the questions in any order within a section or across sections by clicking on the question number given on the number list.<br unselectable="on" style="-moz-user-select: none;">12. You can use rough sheets while taking the test. Do not use calculators, log tables, dictionaries, or any other printed/online reference material during the test.<br unselectable="on" style="-moz-user-select: none;">13. Do not click the button <strong unselectable="on" style="-moz-user-select: none;">“SUBMIT TEST”</strong> before completing the test. A test once submitted cannot be resumed.<br unselectable="on" style="-moz-user-select: none;">14.&nbsp; If your system gets hanged or you face any other problem in internet connectivity, - "Don't Worry, Kindly close the window of the Test and you can resume your test from where you had left."<br unselectable="on" style="-moz-user-select: none;">15. Once clicked on the <strong unselectable="on" style="-moz-user-select: none;">(SUBMIT TEST)</strong> button, You <strong unselectable="on" style="-moz-user-select: none;">Cannot REDO</strong> this Speed Test.....</p>
